import React from 'react';
import s from 'Stories.module.css'
import {StoriesType} from '../../../redux/news_reducer'

type PropsType = {
    story: StoriesType
}

const StoriesItem: React.FC<PropsType> = ({story}) => {


    return <div style={{marginLeft: "15px"}}>
        <img src={story.photo} alt="Photo" style={{width: "85px"}}/>
    </div>
}

export default StoriesItem
